import React, { Component } from "react";

import "./Example.css";
import ExampleCarrousel from "./ExampleCarrousel";

export default class Example extends Component {
  render() {
    return (
      <div className="exampleBottle general_margin">
        <h3 className="home_subsection_white">Exemples de thèmes de mission</h3>
        <div className="exampleTiret" />
        <div class="section group">
          <div class="col span_1_of_2">
            - Politique d'innovation - Business development - Growth-Hacking -
            Stratégie Digitale - Agilité organisationnelle - Innovation
            managériale - Management de projet - Ingénierie de process - Audit -
            Etudes - Knowledge management - Méthodes Qualité
          </div>
          <div class="col span_1_of_2">
            <ExampleCarrousel />
          </div>
        </div>
      </div>
    );
  }
}
